import React from "react";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
// core components
import GridItem from "components/Grid/GridItem.js";
import Grid from '@material-ui/core/Grid';
import CustomInput from "components/CustomInput/CustomInput.js";
import GridContainer from "components/Grid/GridContainer.js";
import Table from "components/Table/Table.js";
import Card from "components/Card/Card.js";
import CardHeader from "components/Card/CardHeader.js";
import CardBody from "components/Card/CardBody.js";
import InputLabel from "@material-ui/core/InputLabel";
import TextField from '@material-ui/core/TextField';
import './TabelList.css'
import Button from "components/CustomButtons/Button.js";
import CardFooter from "components/Card/CardFooter.js";

import { Form, } from 'react-bootstrap'

const styles = {
  cardCategoryWhite: {
    "&,& a,& a:hover,& a:focus": {
      color: "rgba(255,255,255,.62)",
      margin: "0",
      fontSize: "14px",
      marginTop: "0",
      marginBottom: "0"
    },
    "& a,& a:hover,& a:focus": {
      color: "#FFFFFF"
    }
  },
  cardTitleWhite: {
    color: "#FFFFFF",
    marginTop: "0px",
    minHeight: "auto",
    fontWeight: "300",
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    marginBottom: "3px",
    textDecoration: "none",
    "& small": {
      color: "#777",
      fontSize: "65%",
      fontWeight: "400",
      lineHeight: "1"
    }
  }
};
const bgColor = '#0f58d6'

const useStyles = makeStyles(styles);

export default function TableList() {
  const classes = useStyles();
  return (
    <GridContainer>
      <GridItem xs={12} sm={12} md={12}>
        <Card>
          <CardHeader color="danger">
            <h4 className={classes.cardTitleWhite}>اضافه کردن محصول </h4>

          </CardHeader>
          <CardBody>
            <GridItem xs={12} sm={12} md={6}>

              <Grid container spacing={3}>

                <Grid item xs>
                  <TextField
                    label="نام محصول"
                    id="margin-none"

                    className={classes.textField}

                  />

                </Grid>


                <Grid item xs>
                  <TextField
                    label="ای دی محصول"
                    id="margin-none"

                    className={classes.textField}

                  />

                </Grid>








              </Grid>
            </GridItem>

            <GridItem xs={12} sm={12} md={12} className="tabelHead">

              <CustomInput
                labelText="توضیحات محصول"
                id="about-me"
                formControlProps={{
                  fullWidth: true
                }}
                inputProps={{
                  multiline: true,
                  rows: 5
                }}
              />
            </GridItem>

            <GridItem xs={6} sm={6} md={6} className="tabelHead">

              <Form>
                <Form.File
                  id="custom-file"
                  label="Custom file input"
                  custom
                />
              </Form>
            </GridItem>

          </CardBody>
        </Card>
      </GridItem>

      <CardFooter>
        <Button color="primary">ثبت تغییرات </Button>
      </CardFooter>

    </GridContainer>
  );
}
